import React from 'react';
const Link = "home";
const Link2 = "Contact-us";
const Link3 = "Login";
function Header(){
    return(
        <header>
            <ul>
                <li>
                    <a href="{Link}">Home</a>
                </li>
                <li>
                    <a href="{Link2}">Contact Us</a>
                </li>
                <li>
                    <a href="{Link3}">Login</a>
                </li>
            </ul>
        </header>
    );
}
export default Header;
